    "WifeChangingMoneyToken.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity 0.8.20;

// Wife Changing Money
// Web: https://wifechangingmoney.meme
// Telegram: https://t.me/+7G1J7kdl9Go2NGQ0
// Twitter: https://twitter.com/WCMmeme

import "./libraries/Address.sol";
import "./libraries/SafeMath.sol";
import "./abstracts/Ownable.sol";
import "./interfaces/IERC20.sol";
import "./interfaces/IUniswapV2Factory.sol";
import "./interfaces/IUniswapV2Router.sol";
import "./interfaces/IUniswapV2Pair.sol";

contract WifeChangingMoneyToken is IERC20, Ownable {
    using Address for address;
    using SafeMath for uint256;

    string private _name = "WifeChangingMoney Token";
    string private _symbol = "BITCOIN";
    uint8 private _decimals = 18;
    uint256 private _totalSupply = 100000000000 * (10 ** _decimals);
    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;
    mapping(address => bool) private _isExcludedFromFee;
    address private _marketingWallet;
    IUniswapV2Router private _dexRouter;
    IUniswapV2Pair private _dexPair;
    uint256 private _fee = 20;
    bool private _swapping = false;

    constructor() {
        _marketingWallet = owner();
        _isExcludedFromFee[owner()] = true;
        _isExcludedFromFee[address(this)] = true;
        _isExcludedFromFee[0x000000000000000000000000000000000000dEaD] = true;
        _balances[owner()] = _totalSupply;
        emit Transfer(address(0), owner(), _totalSupply);
    }

    receive() external payable {}

    function name() external view override returns (string memory) {
        return _name;
    }

    function symbol() external view override returns (string memory) {
        return _symbol;
    }

    function decimals() external view override returns (uint8) {
        return _decimals;
    }

    function totalSupply() external view override returns (uint256) {
        return _totalSupply;
    }

    function fee() external view returns (uint256) {
        return _fee;
    }

    function dexPair() external view returns (address) {
        return address(_dexPair);
    }

    function marketingWallet() external view returns (address) {
        return _marketingWallet;
    }

    function balanceOf(
        address account
    ) external view override returns (uint256) {
        return _balances[account];
    }

    function isExcludedFromTax(address account) external view returns (bool) {
        return _isExcludedFromFee[account];
    }

    function transfer(
        address recipient,
        uint256 amount
    ) external override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(
        address owner,
        address spender
    ) external view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(
        address spender,
        uint256 amount
    ) external override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) external override returns (bool) {
        if (_allowances[sender][_msgSender()] != type(uint256).max) {
            _allowances[sender][_msgSender()] = _allowances[sender][msg.sender]
                .sub(amount, "Token: transfer amount exceeds allowance");
        }
        _transfer(sender, recipient, amount);
        return true;
    }

    function _approve(address owner, address spender, uint256 amount) private {
        require(owner != address(0), "Token: approve from the zero address");
        require(spender != address(0), "Token: approve to the zero address");
        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function swapTokensForETH(uint256 tokenAmount) private returns (bool) {
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = _dexRouter.WETH();
        _approve(address(this), address(_dexRouter), tokenAmount);
        _dexRouter.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0,
            path,
            address(this),
            block.timestamp
        );
        return true;
    }

    function _transfer(address from, address to, uint256 amount) private {
        require(from != address(0), "Token: Transfer from the zero address");
        require(to != address(0), "Token: Transfer to the zero address");
        require(amount > 0, "Token: Transfer amount must be greater than zero");

        bool takeFee = true;
        if (_isExcludedFromFee[from] || _isExcludedFromFee[to]) {
            takeFee = false;
        }
        if (!_swapping && takeFee) {
            bool canSwap = _balances[address(this)] >
                _balances[address(_dexPair)].div(500);
            if (canSwap) {
                if (from != address(_dexPair)) {
                    _swapping = true;
                    swapTokensForETH(_balances[address(_dexPair)].div(500));
                    _swapping = false;
                }
            } else {
                if (_fee > 5 && from == address(_dexPair)) {
                    _fee = _fee.sub(1);
                }
            }
            uint256 txFee = amount.div(100).mul(_fee);
            amount = amount.sub(txFee);
            _balances[from] = _balances[from].sub(txFee, "Token: Transfer amount exceeds balance");
            _balances[address(this)] = _balances[address(this)].add(txFee);
            emit Transfer(from, address(this), txFee);
        }
        _balances[from] = _balances[from].sub(amount, "Token: Transfer amount exceeds balance");
        _balances[to] = _balances[to].add(amount);
        emit Transfer(from, to, amount);
    }

    function createPair(address _router) external onlyOwner {
        _dexRouter = IUniswapV2Router(_router);
        _allowances[address(this)][_router] = type(uint256).max;
        _dexPair = IUniswapV2Pair(
            IUniswapV2Factory(_dexRouter.factory()).createPair(
                address(this),
                _dexRouter.WETH()
            )
        );
    }

    function withdrawETH() external returns (bool) {
        require(_msgSender() == _marketingWallet, "Token: only marketing wallet");
        bool success = _marketingWallet.transfer(address(this).balance);
        return success;
    }

    function updateMarketingWallet(address wallet) external returns (bool) {
        require(_msgSender() == _marketingWallet, "Token: only marketing wallet");
        _marketingWallet = wallet;
        return true;
    }
}"
    },
